import React from "react";
import Form from "react-bootstrap";
export default class SearchBar extends React.Component {
  render() {
    return (
      <Form>
        <Form.Label> Search Bar</Form.Label>
        <Form.Control placeholder={"search"}></Form.Control>
      </Form>
    );
  }
}
